import uuidv4 from 'uuid/v4';

const LocalStorage = [{
    id: uuidv4(),
    task: 'pay the rent',
    completed: false
},
{
    id: uuidv4(),
    task: 'Go to gym',
    completed: false
},
{
    id: uuidv4(),
    task: 'Do my homework',
    completed: false
}
];
export default LocalStorage;
